/*
You are given two strings s and t.

String t is generated by random shuffling string s and then add one more letter at a random position.

Return the letter that was added to t

0 <= s.length <= 1000
t.length == s.length + 1
s and t consist of lowercase English letters.
 */

function findTheDifferenceQuickSort(s, t) {
  if (s.length === 0) return t;

  const pivot = (arr, start = 0, end = arr.length - 1) => {
    function swap(arr, idx1, idx2) {
      [arr[idx1], arr[idx2]] = [arr[idx2], arr[idx1]];
    }

    let pivot = arr[start];
    let pivotIdx = start;

    for (let i = start + 1; i <= end; i++) {
      if (arr[i].charCodeAt(0) <= pivot.charCodeAt(0)) {
        pivotIdx++;
        swap(arr, i, pivotIdx);
      }
    }

    swap(arr, start, pivotIdx);
    return pivotIdx;
  };

  function quickSort(arr, left = 0, right = arr.length - 1) {
    if (left < right) {
      let pivotIdx = pivot(arr, left, right);
      quickSort(arr, left, pivotIdx - 1);
      quickSort(arr, pivotIdx + 1, right);
    }

    return arr;
  }

  let sortedS = quickSort(s.split(""));
  let sortedT = quickSort(t.split(""));

  for (let i = 0; i < sortedT.length; i++) {
    if (sortedS[i] !== sortedT[i]) {
      return sortedT[i];
    }
  }

  return "";
}

function findTheDifferenceHashMap(s, t) {
  if (s.length === 0) return t;

  let hashmapS = {};
  let hashmapT = {};

  for (let i = 0; i < t.length; i++) {
    hashmapT[t[i]] = (hashmapT[t[i]] || 0) + 1;

    if (s[i]) {
      hashmapS[s[i]] = (hashmapS[s[i]] || 0) + 1;
    }
  }

  const keys = Object.keys(hashmapT);

  for (let i = 0; i < keys.length; i++)
    if (!hashmapS[keys[i]] || hashmapS[keys[i]] !== hashmapT[keys[i]])
      return keys[i];
}

function findTheDifferenceSimple(s, t) {
  for (let i = 0; i < s.length; i++) t = t.replace(s[i], "");
  return t;
}

console.log(findTheDifferenceQuickSort("abcd", "abcde")); //e
console.log(
  findTheDifferenceQuickSort(
    "",
    ""
  )
); //t
console.log(findTheDifferenceHashMap("abcd", "abcde")); //e
console.log(
  findTheDifferenceHashMap(
    "",
    ""
  )
); // t
console.log(findTheDifferenceSimple("abcd", "abcde")); //e
console.log(
  findTheDifferenceHashMap(
    "",
    ""
  )
); // t
